    [],nt"revision_timestamp": "2016-07-27T22:41:37.241900",nt"name": "a-biological-assessment-of-wildcat-landfill-superfund-site",nt"isopen":
    false,nt"url": null,nt"notes": "This document was prepared as part of the
    Wildcat Landfill Remedial Investigation (RI) Report; the report was financed through
    a grant and authority of CERCLA as amended (1986). Several methodologies were employed
    to document impacts of contaminants on natural resources including: biological inventory,
    water and sediment bioassays, contaminant body Burden analysis, and histopathology.
    The contaminant body burden and aquatic bioassays were the most useful of these
    methods, closely followed by histopathology and the biological inventory. Sediment
    bioassays would have been more useful if bulk sediment tests had been done in conjunction
    with the elutriate tests. The first phase of this biological assessment documents
    species that could be affected by contaminants from the Wildcat Landfill. Because
    contaminants could have migrated from the landfill, the biological inventory includes
    not only species using the landfill itself but also those using adjacent wetlands,
    the St. Jones River in the vicinity of the landfill, the bordering pond, and the
    adjacent wooded upland. The emphasis of the biological inventory was to provide
    a general overview of the flora and fauna on and near the site. The inventory noted
    flora and fauna observed during the study period, delineated major habitats present,
    and assessed wetland losses.",nt"license_title": "License Not Specified",nt"extras":
